  false,\n\t\"url\": null,\n\t\"notes\": \"This is a point coverage of the 1990 Census
  of Population and Housing for the conterminous United States. (Alaska and Hawaii
  are available separately). The coverage contains the location of population points
  retrieved at the block group summary level and shows the total number of persons
  and housing units enumerated in the \"100 percent processing\" component of the
  decennial census. The data was extracted from CD-ROMs containing Public Law 94-171
  counts. These are counts that States use in redistricting.\",\n\t\"license_title\":
